1	中国传媒大学 ACM Online Judge Beta 试运行公告	<p>CUC-ACM-OJ 是一个开放的在线程序评测平台。支持<code>markdown</code>语法和$LaTeX$语法，可以使用C/C++、Python、Java等语言进行评测，并且支持自定义题目和数据。</p><p>请注意，本平台目前处于公测阶段，临时部署在云服务器上，<strong>公测结束后所有的信息可能都不会被保留</strong>，目前信息保留时长不超过2个月。</p><p>如果不清楚如何使用请阅读<a href="https://github.com/LyuLumos/CUC-ACM-OJ/blob/main/README.md" target="_blank">使用文档</a>。</p><hr /><ul><li><p>系统预设的普通管理员账号</p><p><code>GeneralAdmin0</code><code>fcfd8ef2</code></p><p><code>GeneralAdmin1</code><code>e13faaa0</code></p><p><code>GeneralAdmin2</code><code>18f4a22c</code></p></li><li><p>超级管理员账号请通过QQ或微信私聊开发者获取。请不要改动其他管理员上传的题目或改变评测机的设置。</p></li></ul><p>您也可以自行创建用户，联系<a href="https://github.com/LyuLumos" target="_blank">开发者</a>(QQ:3208413453)进行账户类型的更改。</p><hr /><p>祝AK。</p><p>LyuLumos 2021年1月4日</p>	2021-01-04 05:00:00.82611+00	2021-01-04 19:50:59.229546+00	t	1
2	关于题库添加题目的公告	<p>接下来一周，陆续会有NOIP的题目添加进题库，使用ICPC判题规则，标准数据，题目难度比较简单。</p><p>也希望有意上传自己题目的同学私聊我提升管理员权限。</p><p>祝好。</p><p>LyuLumos  2021年1月9日</p>	2021-01-08 16:47:25.987591+00	2021-01-08 16:47:25.987633+00	t	1
3	系统维护公告 （2021.1.18-22）	<p>基于当前OJ存在的问题，我们计划于2021年1月18日（周一）开始对整个OJ进行维护，预期历时5天，维护期间无法使用OJ，包括但不限于增加往年蓝桥杯题目、测试备份等操作。系统维护前会对所有数据进行备份，但是可能会丢失部分数据，如果有需要请自行备份代码。</p><p><br /></p><p>LyuLumos</p><p>祝好</p>	2021-01-15 09:04:35.773571+00	2021-01-15 09:05:57.741366+00	t	1
\.


