9	明明的随机数	<p>明明想在学校中请一些同学一起做一项问卷调查，为了实验的客观性，他先用计算机生成了 $N$ 个1到1000之间的随机整数（$N \\leq 100$），对于其中重复的数字，只保留一个，把其余相同的数去掉，不同的数对应着不同的学生的学号。然后再把这些数从小到大排序，按照排好的顺序去找同学做调查。请你协助明明完成“去重”与“排序”的工作。<br /></p>	<p>第1行为1个正整数，表示所生成的随机数的个数：$N$</p><p>第2行有<span style="color: rgb(51, 51, 51);">$N$</span>个用空格隔开的正整数，为所产生的随机数。</p>	<p>第1行为1个正整数 $M$ ，表示不相同的随机数的个数。</p><p>第2行为<span style="color: rgb(51, 51, 51);">$M$</span>个用空格隔开的正整数，为从小到大排好序的不相同的随机数。<br /></p>	[{"input": "10\\n20 40 32 67 40 20 89 300 400 15", "output": "8\\n15 20 32 40 67 89 300 400"}]	5a88f7387b1915c8f2995119d2af1856	[{"score": 10, "input_name": "1.in", "output_name": "1.out"}, {"score": 10, "input_name": "2.in", "output_name": "2.out"}, {"score": 10, "input_name": "3.in", "output_name": "3.out"}, {"score": 10, "input_name": "4.in", "output_name": "4.out"}, {"score": 10, "input_name": "5.in", "output_name": "5.out"}, {"score": 10, "input_name": "6.in", "output_name": "6.out"}, {"score": 10, "input_name": "7.in", "output_name": "7.out"}, {"score": 10, "input_name": "8.in", "output_name": "8.out"}, {"score": 10, "input_name": "9.in", "output_name": "9.out"}, {"score": 10, "input_name": "10.in", "output_name": "10.out"}]		["C", "C++", "Golang", "Java", "Python3"]	{}	2021-01-08 16:16:00.961944+00	\N	1000	256	f	\N	\N	\N	ACM	t	Low	NOIP 2006	1	1	1	1005	{"0": 1}	0	\N	f	f	{"input": "input.txt", "output": "output.txt", "io_mode": "Standard IO"}	f
11	奖学金	<p>某中学最近得到了一笔赞助，打算拿出其中一部分为学习成绩优秀的前5名学生发奖学金。期末，每个学生都有3门课的成绩：语文、数学、英语。先按总分从高到低排序，如果两个同学总分相同，再按语文成绩从高到低排序，如果两个同学总分和语文成绩都相同，那么规定学号小的同学排在前面，这样，每个学生的排序是唯一确定的。</p><p>任务：先根据输入的3门课的成绩计算总分，然后按上述规则排序，最后按排名顺序输出前5名学生的学号和总分。注意，在前5名同学中，每个人的奖学金都不相同，因此，你必须严格按上述规则排序。例如，在某个正确答案中，如果前两行的输出数据（每行输出两个数：学号、总分）是：</p><pre><code>7 279\n5 279\n</code></pre><p>这两行数据的含义是：总分最高的两个同学的学号依次是7号、5号。这两名同学的总分都是279（总分等于输入的语文、数学、英语三科成绩之和），但学号为7的学生语文成绩更高一些。如果你的前两名的输出数据是：</p><pre><code>5 279\n7 279\n</code></pre><p>则按输出错误处理，不能得分。</p>	<p>第1行为一个正整数 n，表示该校参加评选的学生人数。$6<span style="color: rgb(51, 51, 51);">\\leq</span>n \\leq 300$</p><p>第2到n+1行，每行有3个用空格隔开的数字，每个数字都在0到100之间。第j行的3个数字依次表示学号为j-1的学生的语文、数学、英语的成绩。每个学生的学号按照输入顺序编号为1~n（恰好是输入数据的行号减1）。</p>	<p>共有5行，每行是两个用空格隔开的正整数, 依次表示前5名学生的学号和总分。<br /></p>	[{"input": "6\\n90 67 80\\n87 66 91\\n78 89 91\\n88 99 77\\n67 89 64\\n78 89 98", "output": "6 265\\n4 264\\n3 258\\n2 244\\n1 237"}, {"input": "8\\n80 89 89\\n88 98 78\\n90 67 80\\n87 66 91\\n78 89 91\\n88 99 77\\n67 89 64\\n78 89 98", "output": "8 265\\n2 264\\n6 264\\n1 258\\n5 258"}]	e4a2b8a2798c6a6d7813680a4805abf4	[{"score": 10, "input_name": "1.in", "output_name": "1.out"}, {"score": 10, "input_name": "2.in", "output_name": "2.out"}, {"score": 10, "input_name": "3.in", "output_name": "3.out"}, {"score": 10, "input_name": "4.in", "output_name": "4.out"}, {"score": 10, "input_name": "5.in", "output_name": "5.out"}, {"score": 10, "input_name": "6.in", "output_name": "6.out"}, {"score": 10, "input_name": "7.in", "output_name": "7.out"}, {"score": 10, "input_name": "8.in", "output_name": "8.out"}, {"score": 10, "input_name": "9.in", "output_name": "9.out"}, {"score": 10, "input_name": "10.in", "output_name": "10.out"}]		["C", "C++", "Golang", "Java", "Python2", "Python3"]	{}	2021-01-08 16:32:34.818778+00	\N	1000	256	f	\N	\N	\N	ACM	t	Low	NOIP 2007	2	2	1	1007	{"0": 2, "-1": 0}	0	\N	f	f	{"input": "input.txt", "output": "output.txt", "io_mode": "Standard IO"}	f
