14	矩阵取数	<p>宗老师经常跟同学玩一个矩阵取数游戏：对于一个给定的 $n*m$ 的矩阵，矩阵中的每个元素 $a_{ij}$ 均为非负整数。游戏规则如下：</p><p>1、每次取数时须从每行各取走一个元素，共$n$个。$m$次后取完矩阵所有元素；</p><p>2、每次取走的各个元素只能是该元素所在行的行首或行尾；</p><p>3、每次取数都有一个得分值，为每行取数的得分之和，每行取数的得分 = $被取走的元素值*2^i$，其中i表示第i次取数（从1开始编号）；</p><p>4、游戏结束总得分为 $m$ 次取数得分之和。</p><p>ZLS想请你帮忙写一个程序，对于任意矩阵，可以求出取数后的最大得分。</p>	<p>包括 n+1 行：</p><p>第1行为两个用空格隔开的整数 n 和 m 。</p><p>第2~n+1行为 n*m的矩阵，其中每行有 m 个用单个空格隔开的非负整数，大小不超过1000。</p><p><span style="color: rgba(0, 0, 0, 0.75);">$1 \\le n,m \\le 80$</span></p>	<p>包含1行，为一个整数，即输入矩阵取数后的最大得分。<br /></p>	[{"input": "2 3\\n1 2 3\\n3 4 2", "output": "82"}, {"input": "1 4\\n4 5 0 5", "output": "122"}, {"input": "2 10\\n96 56 54 46 86 12 23 88 80 43\\n16 95 18 29 30 53 88 83 64 67", "output": "316994"}]	9e42b95bac78f41d5313ce77036d39f5	[{"score": 10, "input_name": "1.in", "output_name": "1.out"}, {"score": 10, "input_name": "2.in", "output_name": "2.out"}, {"score": 10, "input_name": "3.in", "output_name": "3.out"}, {"score": 10, "input_name": "4.in", "output_name": "4.out"}, {"score": 10, "input_name": "5.in", "output_name": "5.out"}, {"score": 10, "input_name": "6.in", "output_name": "6.out"}, {"score": 10, "input_name": "7.in", "output_name": "7.out"}, {"score": 10, "input_name": "8.in", "output_name": "8.out"}, {"score": 10, "input_name": "9.in", "output_name": "9.out"}, {"score": 10, "input_name": "10.in", "output_name": "10.out"}]	<p>第1次：第1行取行首元素，第2行取行尾元素，本次得分为 $1*2^1+2*2^1=6$</p><p>第2次：两行均取行首元素，本次得分为 $2*2^2+3*2^2=20$</p><p>第3次：得分为$3*2^3+4*2^3=56$。总得分为$6+20+56=82$</p>	["C", "C++", "Golang", "Java", "Python2", "Python3"]	{}	2021-01-08 17:17:49.959683+00	\N	1000	256	f	\N	\N	\N	ACM	t	Low		6	1	1	1010	{"0": 1, "-1": 5}	0	\N	f	f	{"input": "input.txt", "output": "output.txt", "io_mode": "Standard IO"}	f
15	吃点甜的	<p>吕队喜欢吃好吃的，现在有几摞美食优惠券，吕队想尽可能多地得到优惠券。</p><p>但是优惠券的获取方式很有讲究：取得了当前这摞优惠券后，就要隔这摞优惠券数量再取，且第一次取的起点任意。</p><p>问：最多得到的优惠券总数。</p><p>举个例子：有<code>5</code>摞优惠券，分别为<code>7,3,1,2,3</code>。</p><ul><li>起点为<code>1</code>,则答案为<code>7</code>。</li><li>起点为<code>2</code>,则答案为<code>3 + 3 = 6</code>。注：第一次为第二摞，第二次为第五摞。</li><li>起点为<code>3</code>,则答案为<code>1 + 2 = 3</code>。</li><li>起点为<code>4</code>,则答案为<code>2</code>。</li><li>起点为<code>5</code>,则答案为<code>3</code>。</li></ul><p>因此最多能得到<code>7</code>张优惠券。</p>	<p>第一行为$t$($1 \\leq t \\leq 10^{4}$ ),是测试点数量。</p><p>每一组测试用例的第一行为$n$<span style="color: rgb(51, 51, 51);">($1 \\leq n \\leq 2 * 10^{5}$ )，<span style="color: rgb(51, 51, 51);">优惠券</span>的摞数。</span></p><p><span style="color: rgb(51, 51, 51);">每组测试用例接下来的一行有$n$个数，$a_1,a_2...a_n $</span>($1 \\leq a_i \\leq 10^{9}$)，代表每摞<span style="color: rgb(51, 51, 51);">优惠券</span>的数量。</p><p>测试用例总数目<span style="color: rgb(51, 51, 51);">$\\sum n \\leq 2 * 10^{5}$</span><span style="color: rgb(51, 51, 51);">。</span></p>	<p>每个测试用例输出一行一个答案，表示可以获得的<span style="color: rgb(51, 51, 51);">优惠券</span>数量的最大值。</p>	[{"input": "4\\n5\\n7 3 1 2 3\\n3\\n2 1 4\\n6\\n2 1000 2 3 995 1\\n5\\n1 1 1 1 1", "output": "7\\n6\\n1000\\n5"}]	4e39ca334b3501a95d566e3b924dabca	[{"score": 33, "input_name": "1.in", "output_name": "1.out"}, {"score": 33, "input_name": "2.in", "output_name": "2.out"}, {"score": 33, "input_name": "3.in", "output_name": "3.out"}]		["C", "C++", "Golang", "Java", "Python3"]	{}	2021-01-10 15:01:28.931616+00	\N	1000	256	f	\N	\N	\N	ACM	t	Low	Codeforces Round #693 (Div. 3) - C	2	1	17	1011	{"0": 1, "-1": 1}	0	\N	f	f	{"input": "input.txt", "output": "output.txt", "io_mode": "Standard IO"}	f
